// Container.js or Container.tsx
import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Header from '../../ui/header/Header'; // Adjust the import path as necessary
import Sidebar from '../../ui/sidebar/Sidebar'; // Adjust the import path as necessary
import Main from '../../components/Main/Main'; // Adjust the import path as necessary
import About from '../../components/About/About'; // Adjust the import path as necessary
import Settings from '../../components/Settings/Settings'; // Adjust the import path as necessary
import Footer from '../footer/Footer';// Adjust the import path as necessary
import styles from './Container.module.css'; // Ensure you have this CSS module

function Container() {
    return (
        <>
            <Header />
            <div className={styles.contentWrapper}>
                <Sidebar />
                <Routes>
                    <Route path="/" element={<Main />} />
                    <Route path="/about" element={<About />} />
                    <Route path="/settings" element={<Settings />} />
                </Routes>
            </div>
            <Footer />
        </>
    );
}

export default Container;
